import React from "react";
import { Grid, Text, Button, Input, Image } from "../elements";

const Header = (props) => {
  return (
    <React.Fragment>
      <Grid>
        <Image>당근마켓</Image>
        <Input>인풋박스</Input>
        <Button>버튼1</Button>
        <Button>버튼2</Button>
      </Grid>
    </React.Fragment>
  );
};

Header.defaultProps = {};

export default Header;
